	-- 1173 stands for 'Trial'
	print 'Missing subscriptions'
	insert into NewCentralUsers..Subscriptions (sUID, sPID, sExpiryDate, sStatus, sComments)
	select u.uID, 5029, DATEADD(month, -1, GETDATE()), 1173, 'IFLR newsletter, ticket BACO-1061'
	from #tempTable t
	join NewCentralUsers..UserDetails u on u.uusername collate database_default = t.email_address collate database_default
	left join NewCentralUsers..Subscriptions s on s.sUID = u.uID and s.sPID = 5029
	where add_to_newsletter in ('add', 'true') and s.sID is null


