	print 'Opt in'
	insert into NewCentralUsers..Newsletters (nNewsletterID, nPublication, nUID)
	select 613, 5029, u.uID
	from #tempTable t
	join NewCentralUsers..UserDetails u on u.uusername collate database_default = t.email_address collate database_default
	left join NewCentralUsers..Newsletters n on n.nUID = u.uID and n.nPublication = 5029 and n.nNewsletterId = 613
	where add_to_newsletter in ('add', 'true') and n.nNewsletterID is null


	-- Opt Out
	print 'Opt out'
	delete n
	from #tempTable t
	join NewCentralUsers..UserDetails u on u.uusername collate database_default = t.email_address collate database_default
	join NewCentralUsers..Newsletters n on n.nUID = u.uID and n.nPublication = 5029 and n.nNewsletterId = 613
